import{_ as t,o as e,c as i,O as o}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 13.1-1264 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1264.md","filePath":"vacode/13.1-1264.md"}'),a={name:"vacode/13.1-1264.md"},n=o('<h1 id="§-13-1-1264-definitions" tabindex="-1">§ 13.1-1264 Definitions. <a class="header-anchor" href="#§-13-1-1264-definitions" aria-label="Permalink to &quot;§ 13.1-1264 Definitions.&quot;">​</a></h1><p>As used in this article, unless the context requires a different meaning:</p><p>&quot;Articles of organization&quot; has the same meaning specified in § <a href="/vacode/13.1-1002/">13.1-1002</a>.</p><p>&quot;Converting entity&quot; means the domestic or foreign business trust, corporation, limited liability company, limited partnership, partnership, or other entity that adopts a plan of domestication or plan of entity conversion pursuant to this article.</p><p>&quot;Corporation&quot; and &quot;domestic corporation&quot; have the same meaning specified in § <a href="/vacode/13.1-603/">13.1-603</a>.</p><p>&quot;Domesticated business trust&quot; means the domesticating business trust as it continues in existence after a domestication.</p><p>&quot;Domesticating business trust&quot; means the domestic business trust that approves a plan of domestication pursuant to § <a href="/vacode/13.1-1267/">13.1-1267</a> or the foreign business trust that approves a domestication pursuant to the organic law of the foreign business trust.</p><p>&quot;Domestication&quot; means a transaction pursuant to this article, including domestication of a foreign business trust as a domestic business trust or domestication of a domestic business trust in another jurisdiction, where the other jurisdiction authorizes such a transaction even if by another name.</p><p>&quot;Domestic entity&quot; means a domestic corporation, limited liability company, limited partnership, partnership, or other entity.</p><p>&quot;Foreign corporation&quot; has the same meaning specified in § <a href="/vacode/13.1-603/">13.1-603</a>.</p><p>&quot;Foreign entity&quot; means a foreign business trust, corporation, limited liability company, limited partnership, partnership, or other entity.</p><p>&quot;Foreign limited liability company&quot; has the same meaning specified in § <a href="/vacode/13.1-1002/">13.1-1002</a>.</p><p>&quot;Foreign limited partnership&quot; has the same meaning specified in § <a href="/vacode/50-73.1/">50-73.1</a>.</p><p>&quot;Foreign partnership&quot; has the same meaning specified in § <a href="/vacode/13.1-1002/">13.1-1002</a>.</p><p>&quot;Limited liability company&quot; and &quot;domestic limited liability company&quot; have the same meaning specified in § <a href="/vacode/13.1-1002/">13.1-1002</a>.</p><p>&quot;Limited partnership&quot; and &quot;domestic limited partnership&quot; have the same meaning specified in § <a href="/vacode/50-73.1/">50-73.1</a>.</p><p>&quot;Member&quot; has the same meaning specified in § <a href="/vacode/13.1-1002/">13.1-1002</a>.</p><p>&quot;Membership interest&quot; or &quot;interest&quot; has the same meaning specified in § <a href="/vacode/13.1-1002/">13.1-1002</a>.</p><p>&quot;Other entity&quot; means a domestic real estate investment trust or common law trust.</p><p>&quot;Partnership&quot; and &quot;domestic partnership&quot; mean an association of two or more persons to carry on as co-owners a business for profit formed under § <a href="/vacode/50-73.88/">50-73.88</a>, or predecessor law of this Commonwealth, and includes, for all purposes of the laws of this Commonwealth, a registered limited liability partnership.</p><p>&quot;Resulting entity&quot; means the domestic limited liability company or business trust that is in existence upon consummation of an entity conversion pursuant to this article.</p><p>&quot;Surviving entity&quot; means the domestic business trust that is in existence upon consummation of a domestication pursuant to this article.</p><p>2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0621" target="_blank" rel="noreferrer">621</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0288" target="_blank" rel="noreferrer">288</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0487" target="_blank" rel="noreferrer">487</a>.</p>',23),s=[n];function r(p,u,c,m,h,d){return e(),i("div",null,s)}const q=t(a,[["render",r]]);export{f as __pageData,q as default};
